(18, 12, 'Detailed Itinerary Day |01| Arrival: Arrive Kathmandu Airport, Meet With Our Representative Who Will Welcome You With Khada/garland (welcoming Culture In Nepal) And Transfers To The Hotel By Tourist Vehicle. Overnight Stay At The Hotel.  Day |02|kathmandu- Pokhara: Breakfast At Hotel At 6-8 Oâ€™clock, And Then Fly To Pokhara. It Will Take Around Twenty Minutes To Reach Pokhara. Pokhara Is The Natural City Of Lakes And Mountains. After Reaching There, Start Pokhara Valley Sightseeing Including, Sarangkot, Davis Falls (water Fall), Gupteshwor Cave (hidden Mahadev Cave). Rest Of The Day Is For Extra Activities Like Paragliding, Ultra-light Flight, Zip- Flying And Bungee- Jumping, Which Is The Best Fun Work In Pokhara To Feel The Himalayas. Afternoon Is Time For The Shopping And Boating On Fewa Lake (fourth Largest Lake Of Nepal), Visit Talbarahi Temple (located In The Middle Of Fewa Lake). Overnight Stay At Pokhara.  Day |03| Pokhara-kathmandu: Breakfast At Hotel 6-8 Oâ€™clock, Then Departure To Kathmandu. If You Want To Go By Flight It Will Take Half An Hour(it Costs Supplementary Approx Inr 4,100). By Road Needs 6-7 Hours (205km) To Reach Kathmandu, Will Do Lunch On The Highway. On The Way You Can Visit Manakamana Temple (goddess Of Wishes Fulfilling ). Rest Of The Time Is Free For Individual Activities By Own. Overnight Stay At The Hotel.   Day |04| Kathmandu Sightseeing: Breakfast At Hotel, Sightseeing Starts Withpashupatinath Temple (famous Holy Hindu Temple). After This We Will Do Sightseeing Of Bouddhanath Stupa (one Of The Biggest Stupa In The World). Do Lunch In One Of The Palace Areaâ€™s Restaurants. After Lunch Drive To Patan City For Sightseeing (patan Durbar Square, Krishna Temple, Golden Temple, Patan Museum. These Are The Unesco World Heritage Sites. Rest Of The Time Is Free For Individual Activities. Overnight Stay At The Hotel.    Day |05|departure: After Breakfast, Morning Is Free For Individual Activities. Please Be Ready 3 Hours Before The Flight An', 'Iternity', 1, '2023-05-29 01:38:46', '2023-05-30 03:48:40'),
(19, 12, 'Airport pick-up and drop-off service. â€¢	All hotel accommodation. â€¢	All ground transportation as per the itinerary. â€¢	All necessary paper works. â€¢	All government and local taxes.', 'Inclusion', 1, '2023-05-29 01:38:46', '2023-05-30 03:48:34'),
(20, 12, 'International airfare to and from Kathmandu. â€¢	Excess baggage charges. â€¢	Entry fee for world heritage sites, temples. â€¢	Travel Insurance fee and rescue insurance. â€¢	Extra night accommodation in any case. â€¢	Personal nature expenses (phone calls, laundry, bar bills, battery recharge, extra porters, bottle or boiled water, shower etc.). â€¢	Tips for guide and driver. â€¢	Mountain Flight Cost (10,000 INR) â€¢	English speaking tour guide.', 'Exclusion', 1, '2023-05-29 01:38:46', '2023-05-30 03:48:28'),
