(113, 9, ' After Breakfast Start Yatra for 1st Dham Yamunotri.', 'Iternity', 0, '2023-05-30 05:33:14', '2023-05-30 05:33:14'),
(114, 9, 'Yamunotri Temple is dedicated to Goddess Yamuna. Yamunotri is the source of revered river Yamuna which originates from the Champasar Glacier lying 1 Km. Ahead of the shrine situated at an elevation of 3235 meter above sea level. The approach is extremely difficult and pilgrims therefore offer Pooja at the temple itself. Yamunotri was the home of an ancient sage Asit Muni.', 'Iternity', 0, '2023-05-30 05:33:14', '2023-05-30 05:33:14'),
(115, 9, 'Yamuna: - Yamuna is the daughter of the Sun just like Yama who is considered his son. It is believed that Yama would not torment any person at the time of death who bathes in Yamuna, his sister.', 'Iternity', 0, '2023-05-30 05:33:14', '2023-05-30 05:33:14'),
(116, 9, 'Surya Kund: - There are a Number of thermal springs in the vicinity of the temple, which flows into numerous pools. The most important of these is Surya Kund.', 'Iternity', 0, '2023-05-30 05:33:14', '2023-05-30 05:33:14'),
(117, 9, 'Divya Shila: -A rock pillar, worshipped before entering the Yamunotri Temple.', 'Iternity', 0, '2023-05-30 05:33:14', '2023-05-30 05:33:14'),
(118, 9, ' Dinner & Overnight Stay at Barkot.', 'Iternity', 0, '2023-05-30 05:33:14', '2023-05-30 05:33:14'),
(119, 9, 'Day 4th: Barkot to Uttarkashi (80 kms. 3 â€“ 4 Hrs. Travelling to Uttarkashi)', 'Iternity', 0, '2023-05-30 05:33:14', '2023-05-30 05:33:14'),
(120, 9, 'After Breakfast move for Uttarkashi.', 'Iternity', 0, '2023-05-30 05:33:14', '2023-05-30 05:33:14'),
(121, 15, 'Day 01: Cochin to Munnar (130 km / 4hrs approx.)', 'Iternity', 0, '2023-05-30 07:58:08', '2023-05-30 07:58:08'),
(122, 15, 'The tour starts from Cochin and the journey leads to a further destination which is Munnar. The place Munnar is at a distance of 4 hours and 130 km from Cochin. On the way to Munnar, travelers can see the mesmerizing beauty of nature and by evening reach the hotel. Enjoy a comfortable time in the hotel and stay overnight there.', 'Iternity', 0, '2023-05-30 07:58:08', '2023-05-30 07:58:08'),
(123, 15, 'Day 02: Munnar', 'Iternity', 0, '2023-05-30 07:58:08', '2023-05-30 07:58:08'),
(124, 15, 'The next day will be full of fun and adventure as tourists are offered splendid sightseeing at Munnar. In Munnar sightseeing, there are endless things to enjoy like the Tea Museum, Tea Gardens, Mattupetty, Devikulam, Eravikulam National Park, and so on. Apart from sightseeing, tourists can spend the evening engaging in leisure activities in hotels and the night will be spent in the same hotel.', 'Iternity', 0, '2023-05-30 07:58:08', '2023-05-30 07:58:08'),
(125, 15, 'DAY 03 Munnar to Thekkadi (99 km / 2hrs approx)', 'Iternity', 0, '2023-05-30 07:58:08', '2023-05-30 07:58:08'),
(126, 15, 'After breakfast check out from Munnar and proceed to Thekkadi and check in and proceed to local sightseeing. Overnight Stay at Thekkadi.', 'Iternity', 0, '2023-05-30 07:58:08', '2023-05-30 07:58:08'),
(127, 15, 'Day 04: Thekkadi to Alleppey (150 km / 4hrs approx)', 'Iternity', 0, '2023-05-30 07:58:08', '2023-05-30 07:58:08'),
(128, 15, 'Alleppey is the destination for this day and it is 135 km away from Thekkady. So, in the morning, after eating breakfast in the hotel, you will depart for Alleppey by checking into a Houseboat. Enjoy a backwater cruise. Overnight stay in Houseboat.', 'Iternity', 0, '2023-05-30 07:58:08', '2023-05-30 07:58:08'),
(129, 15, 'Day 05: Alleppey - Cochin ', 'Iternity', 0, '2023-05-30 07:58:08', '2023-05-30 07:58:08'),
(130, 16, 'Meet our representative at Srinagar airport, transfer to hotel / Houseboat. Afternoon, leave for local sightseeing of Srinagar City. Visit: - Mughal  gardens: - ChesmaShahi (Mughal Spring), Nishat (The Garden of Bliss), Shalimar (The Abode of Love). In the evening, shikara ride in world famous dal lake. Overnight stay at Srinagar.', 'Iternity', 0, '2023-05-31 05:51:40', '2023-05-31 05:51:40'),
(131, 16, 'After breakfast, transfer to Gulmarg for a daytrip via Tangmarg, Enroute Apple Orhards & Cherry Orchards. In Gulmarg visit Khilanmarg and take a ride in worlds highest cable car \"Gondola\" or enjoy your day by playing golf in the worldâ€™s highest golf course ( on your iwn cost ). Return to Srinagar in the evening after enjoying your day. Overnight stay at Srinagar. ', 'Iternity', 0, '2023-05-31 05:56:46', '2023-05-31 05:56:46'),
(132, 16, 'After breakfast, transfer to Pahalgam for a daytrip, Enroute visit Awantipora Ruins, Saffron Fields. In Pahalgam you can visit: - Aru ,Betaab valley (on your own cost). Return to Srinagar in the evening after enjoying your day. Overnight stay at Srinagar.', 'Iternity', 0, '2023-05-31 05:56:46', '2023-05-31 05:56:46'),
(133, 16, 'After breakfast, transfer to Sonmarg for a daytrip. Enroute see Hazratbal Shrine, Gagangir Tourist Village. The drive from Srinagar to Sonmarg is very beautiful as you will pass through some towns and villages, at many places you can enjoy the view of paddy fields with rivers flowing on one side. In Sonmarg you can visit Thajwas Glacier which is around 4 Kms from Sonmarg, a local taxi has to be hired for it ( on your own cost ).  The name Sonmarg is derived from two Kashmiri words â€œSonâ€ & â€œMargâ€ which mean â€œGoldâ€ & â€œMeadowâ€, when put together it means â€œMeadow of Goldâ€. Return to Srinagar in the evening after enjoying your day. Overnight stay at Srinagar. ', 'Iternity', 0, '2023-05-31 05:56:46', '2023-05-31 05:56:46'),
