(237, 28, 'Guwahati Airport / Rly Station â€“ Kaziranga National Park (220 Kms / 5 Hrs.): On Arrival At Guwahati Airport / Railway Station & Transfer To Kaziranga National Park, The Home Of â€œone Horned Rhinocerosâ€, Check In At Your Hotel. Evening Is Free For Leisure. Overnight Stay At Kaziranga.', 'Iternity', 0, '2023-06-19 02:14:18', '2023-06-19 03:44:28'),
(238, 28, 'Kaziranga National Park: Early Morning Explores Any One Zone Of Kaziranga National Park On Back Of Elephant. Apart From The Rhino, Other Species Found Are Hog Deer, Swamp Deer, Wild Buffalo, Elephants And If You Are Lucky Then Tiger Also. It Is Also Home To Pelicans, Storks And Darters As There Are A Number Of Water Bodies Inside The Park. Return To The Resort For Breakfast. In The Afternoon Enjoy Jeep Safari Through The National Park. Return To The Hotel. Overnight Stay At Kaziranga.', 'Iternity', 0, '2023-06-19 02:14:18', '2023-06-19 03:44:12'),
(239, 28, 'sdfsfdsf', 'Iternity', 1, '2023-06-19 02:27:35', '2023-06-19 02:27:46'),
(240, 28, 'Kaziranga National Park â€“ Shillong (295 kms / 7 hrs.): After breakfast proceed for Shillong (4,900 ft.), called â€œScotland of the East\". Enroute visit Umium Lake, a majestic placid lake with its surrounding sylvan hills. On arrival at Shillong, check in to hotel. Evening is free for leisure. Overnight stay at Shillong.', 'Iternity', 0, '2023-06-19 02:28:25', '2023-06-19 02:28:25'),
(241, 28, 'Excursion to Cherrapunjee (60 kms / 2 hrs.): After early breakfast drive to Cherrapunjee (4,400 ft.), the wettest place in the world. You will see the beautiful waterfall known as Nohkalikai. You can also explore the caves known as Mawsmai. Evening return to Shillong, enroute visit Elephanta falls and Shillong peak for some breathtaking views. Overnight stay at Shillong.', 'Iternity', 0, '2023-06-19 02:33:46', '2023-06-19 02:33:46'),
(242, 28, 'Excursion to Mawlynnong & Dawki (120 kms / 4 hrs.): After early breakfast drive to Mawlynnong â€“ â€œAsiaâ€™s Cleanest Villageâ€. Mawlynnong offers many interesting sights such as the living root bridge and another strange natural phenomenon of a boulder balancing on another small rock. Later proceed to Dawki, a small town near India Bangladesh border. Enjoy breathtaking view of the Umangot River. Evening drive back to Shillong. Stay overnight at your hotel in Shillong.', 'Iternity', 0, '2023-06-19 02:33:46', '2023-06-19 02:33:46'),
(243, 28, 'Shillong Sightseeing â€“ Guwahati (100 kms / 3 hrs.): After breakfast visit Don Bosco Museum & Wardâ€™s Lake. After that drive to Guwahati. Arrive and check in at hotel. In evening we suggest an optional tour of Golden sunset cruise on the Brahmaputra (Direct Payment by own). Overnight stay at Guwahati.', 'Iternity', 0, '2023-06-19 02:33:46', '2023-06-19 02:33:46'),
(244, 28, 'Hotel â€“ Guwahati Airport / Rly Station: After breakfast visit Kamakhya Temple, etc. Transfer to Guwahati Airport / Railway Station for your onward journey.', 'Iternity', 0, '2023-06-19 02:33:46', '2023-06-19 02:33:46'),
