(291, 31, 'Meet & Greet on arrival at NJP Railway Station / IXB Airport & transfer to Darjeeling (6,950 ft.). On arrival Check-in to hotel & rest of the day at leisure. Overnight stay at Darjeeling.', 'Iternity', 0, '2023-06-19 06:09:16', '2023-06-19 06:09:16'),
(292, 31, 'Early Morning (at 04:00 am) drive to Tiger hill (8,400 ft.) to watch the spectacular sunrise over Mt. Khangchendzongha (28,208 ft. Worlds 3rd highest peak), on your way back visit Ghoom Monastery and Batasia Loop. After breakfast visit Himalayan Mountaineering Institute, P.N. Zoological Park (Thursday closed), Tenzing Rock, Tibetan Refugee self-help Centre (Sunday closed), Tea Garden (outer view), Ropeway and Japanese Temple. Evening free for shopping or leisure. Overnight stay at Darjeeling.', 'Iternity', 0, '2023-06-19 06:09:16', '2023-06-19 06:09:16'),
(293, 31, 'After Breakfast transfer to Kalimpong (3,950 ft.). On arrival Check-in to your hotel. Afternoon enjoy half day tour of Kalimpong Visit Mangal Dham, Deolo Hill, Dr. Grahamâ€™s Home, Golf Garden, Durpin Dara Hills & Pine View Nursery. Overnight stay at Kalimpong.', 'Iternity', 0, '2023-06-19 06:09:16', '2023-06-19 06:09:16');
