(294, 31, 'After breakfast transfer to Gangtok (5,500 ft.). On arrival check-in to your hotel. Afternoon proceed for a half day city tour visiting Flower show, Cottage Industry and Handicraft Centre, Institute of Tibetology, Dro-dul Chorten, Enchey Monastery & Banjakhri Falls (maximum 3-4 hours). Overnight stay at Gangtok. ', 'Iternity', 0, '2023-06-19 06:09:16', '2023-06-19 06:09:16'),
(295, 31, 'After breakfast start for an excursion to Tsomgo Lake (12,400 ft.) & Baba Mandir (13,200 ft.) which is 55 kms one way from Gangtok city. Overnight stay at Gangtok.', 'Iternity', 0, '2023-06-19 06:09:16', '2023-06-19 06:09:16'),
(296, 31, 'After breakfast Check-out from hotel in time and take the departure transfer to NJP Railway Station / IXB Airport for your onward journey.', 'Iternity', 0, '2023-06-19 06:09:16', '2023-06-19 06:09:16'),
