(305, 33, 'The tour starts from Cochin and the journey leads to a further destination which is Munnar. The place Munnar is at a distance of 4 hours and 130 km from Cochin. On the way to Munnar, travelers can see the mesmerizing beauty of nature and by evening reach the hotel. Enjoy a comfortable time in the hotel and stay overnight there.', 'Iternity', 0, '2023-06-20 06:07:08', '2023-06-20 06:07:08'),
(306, 33, 'The next day will be full of fun and adventure as tourists are offered splendid sightseeing at Munnar. In Munnar sightseeing, there are endless things to enjoy like the Tea Museum, Tea Gardens, Mattupetty, Devikulam, Eravikulam National Park, and so on. Apart from sightseeing, tourists can spend the evening engaging in leisure activities in hotels and the night will be spent in the same hotel.', 'Iternity', 0, '2023-06-20 06:07:08', '2023-06-20 06:07:08'),
(307, 33, 'After breakfast check out from Munnar and proceed to Thekkadi and check in and proceed to local sightseeing. Overnight Stay at Thekkadi.', 'Iternity', 0, '2023-06-20 06:07:08', '2023-06-20 06:07:08'),
(308, 33, 'Alleppey is the destination for this day and it is 135 km away from Thekkady. So, in the morning, after eating breakfast in the hotel, you will depart for Alleppey by checking into a Houseboat. Enjoy a backwater cruise. Overnight stay in Houseboat.', 'Iternity', 0, '2023-06-20 06:07:08', '2023-06-20 06:07:08'),
(309, 33, 'After breakfast, pack your baggage with a promise to come back again to God&apos;s Own Country. Proceed to Kochi Airport/Railway station on time to board your flight/train with a lot of sweet memories of your holidaysâ€¦. ', 'Iternity', 0, '2023-06-20 06:07:08', '2023-06-20 06:07:08'),
